import DOM from '../helper/DOM';
import Workspace from '../workspace/Workspace';
import Log from '../../status/Log';
import Cursor from '../cursor/Cursor';
import Component from '../Component';
import Drop from '../Drop';

export default class Alca {

	//static get SELECTOR() { return '.ux-alca' }
	//static get CLASS() { return 'ux-alca' }

	static get FLAG_MOVE() { return 'cursor-move' }

	static init() {

		//Cria components HTML
		Alca.createComponents();

		//Adiciona no iframe
		DOM.$iframe('body').appendChild(Alca.alcaElement);
	}

	static dragstart(event) {

	}

	static dragend(event) {
		//Mostra que componente foi solto
		Log.default(`Componente solto`);

		//Desliga o cursor após o término da operação
		Cursor.detach();

		//Desiga a alça
		Alca.hide();
	}

	static mousedown(event) {
		if (DOM.getAttr('ux-flag', event.target) != Alca.FLAG_MOVE) {
			// Caso click no interior de uma alça, desliga a mesma
			Alca.hide();
		}
	}

	static createComponents() {

		//Cria botão de movimentação
		Alca.moveElement = DOM.$iframe('#moveElement') || DOM.str2Element(`<img title="Move" draggable="true" ux-flag="${Alca.FLAG_MOVE}" src="data:image/png;base64,">`);
		Alca.moveElement.id = 'moveElement';
		Alca.moveElement.style.cursor = 'move';
		Alca.moveElement.style.width = '15px';
		Alca.moveElement.style.position = 'relative';
		Alca.moveElement.style.left = '-2px';
		Alca.moveElement.style.top = '2px';
		Alca.moveElement.addEventListener('dragstart', Alca.dragstart.bind(this), false);
		Alca.moveElement.addEventListener('dragend', Alca.dragend.bind(this), false);

		//Cria botão de remoção		
		Alca.removeElement = DOM.$iframe('#removeElement') || DOM.str2Element(`<img title="Remove" draggable="false" ux-flag="${Alca.FLAG_MOVE}" src="data:image/png;base64,">`);
		Alca.removeElement.id = 'removeElement';
		Alca.removeElement.style.cursor = 'pointer';
		Alca.removeElement.style.width = '15px';
		Alca.removeElement.style.position = 'relative';
		Alca.removeElement.style.left = '3px';
		Alca.removeElement.style.top = '2px';
		Alca.removeElement.addEventListener('click', Alca.remove.bind(this), false);

		//Cria botão de duplicação		
		Alca.duplicateElement = DOM.$iframe('#duplicateElement') || DOM.str2Element(`<img title="Duplicate" draggable="false" ux-flag="${Alca.FLAG_MOVE}" src="data:image/png;base64,">`);
		Alca.duplicateElement.id = 'duplicateElement';
		Alca.duplicateElement.style.cursor = 'pointer';
		Alca.duplicateElement.style.width = '15px';
		Alca.duplicateElement.style.position = 'relative';
		Alca.duplicateElement.style.left = '8px';
		Alca.duplicateElement.style.top = '2px';
		Alca.duplicateElement.addEventListener('click', Alca.duplicate.bind(this), false);

		//Cria barra de botões
		Alca.barElement = DOM.$iframe('#barElement') || DOM.str2Element(`<div></div>`);
		Alca.barElement.id = 'barElement';
		Alca.barElement.style.position = 'absolute';
		Alca.barElement.style.widows = '50px';
		Alca.barElement.style.pointerEvents = 'all';
		Alca.barElement.style.whiteSpace = 'nowrap';
		Alca.barElement.style.top = '-20px';
		Alca.barElement.style.left = '-1px';
		Alca.barElement.style.display = 'block';
		Alca.barElement.style.height = '20px';
		Alca.barElement.style.backgroundColor = '#3E8CE4';
		Alca.barElement.style.borderRadius = '2px 2px 0 0';
		Alca.barElement.style.cursor = 'move !important';
		Alca.barElement.style.paddingLeft = '5px';
		Alca.barElement.style.paddingRight = '5px';
		Alca.barElement.style.color = 'white';
		Alca.barElement.style.width = '62px';		    

		//Cria alça
		Alca.alcaElement = DOM.$iframe('#alcaElement') || DOM.str2Element(`<div></div>`);
		Alca.alcaElement.id = 'alcaElement';
		Alca.alcaElement.style.position = 'absolute';
		Alca.alcaElement.style.border = '1px solid #3E8CE4';
		Alca.alcaElement.style.boxSizing = 'content-box';
		Alca.alcaElement.style.pointerEvents = 'none';
		Alca.alcaElement.style.display = 'none';
		Alca.alcaElement.style.zIndex = '6';
		Alca.alcaElement.style.borderRadius = '2px';
		Alca.alcaElement.style.boxShadow = '1px 1px 0 rgba(255,255,255,0.2), 1px 1px 0 rgba(255,255,255,0.2) inset';
		Alca.alcaElement.addEventListener('mousedown', Alca.mousedown.bind(this), false);

		//Estrutura components
		Alca.barElement.appendChild(Alca.moveElement);
		Alca.barElement.appendChild(Alca.removeElement);
		Alca.barElement.appendChild(Alca.duplicateElement);
		Alca.alcaElement.appendChild(Alca.barElement);
	}

	/**
	 * REMOVE O COMPONENT
	 */
	static remove(){
		Alca.component.remove();
		Alca.hide();

		//NA ALÇA, APÓS REMOVER O COMPONENT
		Workspace.event.emit('component$remove');
	}

	/**
	 * DUPLICATE O COMPONENT
	 */
	static duplicate(){
		Alca.component.insertAdjacentElement('afterend', Alca.component.cloneNode(true));

		//NA ALÇA, APÓS DUPLICAR O COMPONENT
		Workspace.event.emit('component$duplicate');
	}

	/**
	 * Mostra a alça	 
	 */
	static show() {
		let rect = Alca.component.getBoundingClientRect();

		Alca.alcaElement.style.top = `${rect.top + Workspace.offSetY}px`;
		Alca.alcaElement.style.left = `${rect.left + Workspace.offSetX}px`;
		Alca.alcaElement.style.width = `${rect.width}px`;
		Alca.alcaElement.style.height = `${rect.height}px`;
		Alca.alcaElement.style.display = 'block';
	}
	/**
	 * Esconde a alça
	 */
	static hide() {
		if(!Alca.alcaElement) return;

		if(!Alca.alcaElement.style) return;		

		Alca.alcaElement.style.display = 'none';
	}
}